574\uB3C4 \uB420\uAE4C\uB77C\uB294 \uC0DD\uAC01\uB3C4 \uB4E0\uB2E4. \uAC19\uC774 \uC77C\uD558\uB294 \uC0AC\uB78C\uB3C4 \uC788\uB294\uB370, \uB098\uB9CC \uB530\uB85C \uC9C4\uD589\uD55C\uB2E4\uB294 \uAC83\uC774 \uC880 \uAEC4\uB044\uB7FD\uAE30\uB3C4 \uD558\uB2E4. \uACF5\uBD80\uB97C \uD558\uBA74\uC11C \uC9C4\uD589\uD558\uB294 \uD504\uB85C\uC81D\uD2B8, \uADF8\uB9AC\uACE0 \uC544\uC8FC \uAC04\uB2E8\uD55C \uC6F9\uC0AC\uC774\uD2B8 \uD558\uB098 \uC815\uB3C4 \uB9CC\uB4DC\uB294 \uAC83\uC740 \uAD1C\uCC2E\uC744 \uAC83 \uAC19\uAE30\uB3C4 \uD558\uB2E4. \uC800\uBC88\uC8FC\uC5D0\uB294 \uC774\uAC83\uC800\uAC83 \uCC3E\uC544\uBCF4\uACE0 \uD558\uC600\uB294\uB370, \uB9C9\uC0C1 \uC2DC\uAC04\uC744 \uB0BC \uC218 \uC788\uC744 \uB54C\uB294 \uB864\uC744 \uD558\uAE30 \uBC14\uC058\uB2E4. \uC774\uC81C\uAECF \uC548\uD588\uB358 \uAC83\uC5D0 \uB300\uD55C \uBCF4\uC0C1\uC774\uB77C\uB3C4 \uBC1B\uACE0 \uC2F6\uC740 \uAC83\uC778\uC9C0, \uC774\uAC83 \uC800\uAC83 \uB9CE\uC774 \uD574\uBCF4\uACE0 \uC2F6\uB2E4\uB294 \uB290\uB08C\uC774\uB2E4. \uC8FC\uB9D0\uC740 \uB9CE\uC740 \uC2DC\uAC04\uC744 \uAC8C\uC784\uD558\uB294\uB370 \uBCF4\uB0C8\uB2E4. \uBB54\uAC00 \uD558\uB098\uAC00 \uBE60\uC9C4 \uAC83 \uAC19\uB2E4. \uBB34\uC5C7\uC778\uAC00 \uC5F4\uC815\uC744 \uAC00\uC9C0\uACE0 \uC9C1\uC811 \uC2DC\uAC04\uC744 \uB0B4\uC5B4 \uB9C9 \uC5F4\uC2EC\uD788 \uD558\uB358 \uB54C\uC758 \uB290\uB08C\uC774 \uC5C6\uB2E4. \uADF8\uC5D0 \uB530\uB77C \uBAB8\uB3C4 \uC27D\uAC8C \uC9C0\uCE58\uB294 \uAC83 \uAC19\uACE0, \uD504\uB85C\uADF8\uB7A8\uC744 \uD558\uB2E4 \uBCF4\uBA74 \uC878\uAE30 \uC77C\uC464\uB2E4. \uBB34\uC5C7\uC778\uAC00 \uBCC0\uD654\uAC00 \uD544\uC694\uD558\uB2E4. \uC0C8\uB85C\uC6B4 \uB3C4\uC804\uC774 \uD544\uC694\uD558\uB2E4. \uC0C8\uB85C\uC6B4 \uBAA9\uD45C\uAC00 \uD544\uC694\uD558\uB2E4. \uBCC0\uD654\uAC00 \uD544\uC694\uD574. \uBB34\uC5C7\uC774 \uC788\uC744\uAE4C."), mdx("p", null, "\uB204\uAD70\uAC00\uB97C \uB3C4\uC640\uC900\uB2E4\uAC70\uB098. \uC0C8\uB85C\uC6B4 \uAC83\uC744 \uBC30\uC6B4\uB2E4\uAC70\uB098. \uC0C8\uB85C\uC6B4 \uD5